import React from 'react'
import styles from '../styles/signin.module.css'
import loginBG from '../assets/images/login-bg.jpg'
const SignIn = () => {
  return (
    <div className={styles.outerointainer}>
        <img style={{height: '1200px', width: '100%'}} alt='this is background image' src={loginBG}></img>
    </div>
  )
}

export default SignIn
